import React from 'react';
import { Row, Col } from 'antd';
import 'antd/dist/antd.css'
import './GameList.css';
import iconlv from '../../images/GameList/1@2x.png';
import right from '../../images/GameList/Right@32.png'



class GameList extends React.Component{
    constructor(porps){
        super(porps);
        //设置当前页面title
        document.getElementsByTagName("title")[0].innerText = 'Game Center';
        this.state={
            list:[
                {   
                    id:1,
                    img:"https://lh3.googleusercontent.com/WRTLHUBSdHGJkRRWhrnt_XIuoOPX7RFRwnO9U56l-OXVrFGfKQpEUyyuCEabadj3NX8=s180-rw",
                    name:'Game Name',
                    desc:"这是简介这是简介这是简介这是简介这是简介这是简介这是简，介这是简介这是简介，这是简介这是简介这是简介这是简介这是简介，这是简介这是简介。",
                    lv:1,
                },
                {
                    id:2,
                    img:"https://lh3.googleusercontent.com/OmRFgoSS-iZDwzkMpygYEjbBkpY-_fpE2CEiEgj2KG0yoj2DcP01fbGMutWEf8ip2tiv=s180-rw",
                    name:'Game Name',
                    desc:"这是简介这是简介这是简介这是简介这是简介这是简介这是简，介这是简介这是简介，这是简介这是简介这是简介这是简介这是简介，这是简介这是简介。",
                    lv:3,
                },
                {
                    id:3,
                    img:"https://lh3.googleusercontent.com/RfR1KQy4DjAQ6jhaWowa1NumF8KxxQ0J6-Do8EO0juLgeby2cTkzZteKPvYQIor3dw=s180-rw",
                    name:'Game Name',
                    desc:"这是简介这是简介这是简介这是简介这是简介这是简介这是简，介这是简介这是简介，这是简介这是简介这是简介这是简介这是简介，这是简介这是简介。",
                    lv:2,
                },
                {
                    id:4,
                    img:"https://lh3.googleusercontent.com/7lKxelPf11zp7e1BBJeZua4a-aT5MNKbEfluXOK2-8m_kK9uIVhNAFOTsTMPzQ9tito=s180-rw",
                    name:'Game Name',
                    desc:"这是简介这是简介这是简介这是简介这是简介这是简介这是简，介这是简介这是简介，这是简介这是简介这是简介这是简介这是简介，这是简介这是简介。",
                    lv:5,
                },
                {
                    id:5,
                    img:"https://lh3.googleusercontent.com/Xvzm9AdC2rEpP_gcwoJWBD7BsDClyOhRZ5AmIyhZDKRRCB2k1hdovUqpLgEIcx5b1YY=s180-rw",
                    name:'Game Name',
                    desc:"这是简介这是简介这是简介这是简介这是简介这是简介这是简，介这是简介这是简介，这是简介这是简介这是简介这是简介这是简介，这是简介这是简介。",
                    lv:3,
                },
                {
                    id:6,
                    img:"https://lh3.googleusercontent.com/YWVTzIVX9_nZUfF8zG10eZ4Vs-qn1OpQ2MrJQ7RMjAyVXNa9NiZ6RQJ-1aXSy0lzYUs=s180-rw",
                    name:'Game Name',
                    desc:"这是简介这是简介这是简介这是简介这是简介这是简介这是简，介这是简介这是简介，这是简介这是简介这是简介这是简介这是简介，这是简介这是简介。",
                    lv:4,
                }
            ]
        }
    }

    getUid(){
        const url = window.location.href
        let uid = url.match(/[^a-zA-Z0-9]u{1,1}=([0-9]+)/)
        let did = url.match(/[^a-zA-Z0-9]c{1,1}=([a-z0-9]+)/)
        this.user.uid = uid[1]
        this.user.deviceId = did[1]
        if(this.user.uid == null || this.user.uid == 'null'){
            this.loginShow =true
        }else{
            this.getUserInfo()
        }
    }

    render(){
        return(
            <div id="GameLiet">
                <div className="head">
                    <div className="new-game">New Games</div>
                    <div className="more">More</div>
                </div>
                <div>
                    {
                        this.state.list.map(function(item){
                            return (
                                <Row  className="game-list" key={item.id}>
                                    <Col span="5" className="game-img">
                                        <div className="img">
                                            <img src={item.img} alt=""/>
                                        </div>
                                    </Col>
                                    <Col span="14" className="game-text">
                                        <div className="game-name">{item.name}</div>
                                        <div className="game-lv">
                                            {item.lv>=1?<img src={iconlv} alt=""/>:''}
                                            {item.lv>=2?<img src={iconlv} alt=""/>:''}
                                            {item.lv>=3?<img src={iconlv} alt=""/>:''}
                                            {item.lv>=4?<img src={iconlv} alt=""/>:''}
                                            {item.lv>=5?<img src={iconlv} alt=""/>:''}
                                        </div>
                                        <div className="introduction">{item.desc}</div>
                                    </Col>
                                    <Col  span="3" className="more-ico">
                                        <img src={right} alt=""/>
                                    </Col>
                                </Row>
                            )
                        })
                    }
                    
                </div>
            </div>
        )
    }
}

export default GameList;
